import Enum from "../Enumeradore";

const _enum = new Enum();

const initialState = {
  pokemonIDNAME: null,
  pokemons: null,
  typesAll: null,
};

function reducerRoot(state = initialState, action) {
  switch (action.type) {
    // Aca va tu codigo;
    case _enum.CLEAR:
      return {
        ...state,
        pokemons: action.payload,
        pokemonIDNAME: action.payload,
      };
    //______________________________________________
    case _enum.GET_POKE_ID_NAME:
      return {
        ...state,
        pokemonIDNAME: action.payload,
      };

    //____________________________________________________
    case _enum.GET_POKEMONS:
      return { ...state, pokemons: action.payload };

    //_____________________________________________________________
    case _enum.GET_ALLTYPES:
      return {
        ...state,
        typesAll: action.payload,
      };

    default:
      return state;
  }
}

export default reducerRoot;
